def CreateJSON(request):
    if request.method == 'GET':
        subject = 'TESTING EMAIL DARI JANGO'
        message = 'INI TESTING EMAIL KIRIM DARI DJANGO'
        email_from = settings.EMAIL_HOST_USER
        paramsJSON = {
            'response' : {
                'msg':'success',
                'subject':subject,
                'message':message,
                'email_from' :email_from
            }
        }
        build_dir = ''
        file_dir = 'static/public_asset/upload/json'
        split_dir = file_dir.split('/')

        for f_dir in split_dir:
            build_dir = build_dir+f_dir+'/'
            if not os.path.exists(build_dir):
                os.makedirs(build_dir)

        file_dir = build_dir+'try-create-file.json'
        with open(file_dir, 'w') as createJson:
            json.dump(paramsJSON, createJson)

        return JsonResponse(paramsJSON)
    else:
        pass

